PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?member ?dob WHERE {
  VALUES ( ?show ) {
    ( wd:Q48817408 )
  }
  ?show wdt:P161 ?member .
  ?member wdt:P569 ?dob .
}
ORDER BY ASC ( ?dob )
LIMIT 1

PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?magazine ?date WHERE {
  wd:Q696071 wdt:P1433 ?magazine .
  ?magazine wdt:P571 ?date .
  OPTIONAL {
    ?magazine rdfs:label ?magazineLabel FILTER ( LANG( ?magazineLabel ) = "en" )
  }
  .
}
